import styled from "styled-components";


const Styled = styled.div`
    input[type=date] {
        line-height: 20px;
    }
    label {
        font-weight: unset;
        padding-bottom: 2px;
    }

    .btn-end-position{
        display: flex;
        justify-content: center;
    }
    .btn-send-Leader{
        background-color: #7367ef;
        color: #fff;
        height: 32px;
        margin: 0 5px;
    }
    .btn-close {
        background-color: #ff9e43;
        color: #fff;
        height: 32px;
        margin: 0 6px;
    }
    .ant-col {
        padding: 0 4px;
    }

    
`
export default Styled;
